import React, { Component } from 'react';
import API from "../api/api";
import SearchRes from "../components/";
import M from 'materialize-css';
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";
import "./homePage.css";
pdfMake.vfs = pdfFonts.pdfMake.vfs;

class homePage extends Component {
    constructor() {
        super();
        this.state = {
            trials: [],
            savedTrials: [],
            topic: null,
            fileNameInput: '',
            docDefinition: {} 
        };
    };

    componentDidMount() {
        document.getElementById('searchInput').focus();
        document.addEventListener('DOMContentLoaded', function () {
            var elems = document.querySelectorAll('.collapsible');
            M.Collapsible.init(elems, {});
        });
        document.addEventListener('DOMContentLoaded', function () {
            var elems = document.querySelectorAll('.modal');
            M.Modal.init(elems, {});
        });
    };

    handleInputChange = event => {
        const {name, value} = event.target;
        this.setState({[name]: value });
    };

    downloadPdf = () => {
        if (this.state.fileNameInput === '') {

        }
        pdfMake.createPdf(this.state.docDefinition).download(`${this.state.fileNameInput}.pdf`);
    };

    createPreview = () => {
        document.getElementById('fileNameInput').focus();

        const data = this.state.savedTrials.map((a, i) => [a.public_title, !a.interventions ? 'No interventions provided' : a.interventions.length === 0 ? 'No interventions provided' : { ul: a.interventions.map((el, i) => el.name) }, !a.conditions ? 'No conditions provided' : a.conditions.length === 0 ? 'No conditions updates provided' : { ul: a.conditions.map((el, i) => el.name) }, !a.publications ? 'No publications provided' : a.publications.length === 0 ? 'No publications provided' : { ul: a.publications.map((el, i) => el.title) }, !a.locations ? 'No locations provided' : a.locations.length === 0 ? 'No locations provided' : { ul: a.locations.map((el, i) => el.name) }]);

        const dataWithHeaders = [[{ text: 'Title', style: 'tableHeader' }, { text: 'Interventions', style: 'tableHeader' }, { text: 'Conditions', style: 'tableHeader'}, { text: 'Publications', style: 'tableHeader' }, { text: 'Locations', style: 'tableHeader' }]].concat(data);

        const docDefinition = {
            styles: {
                header: {
                    fontSize: 18,
                    bold: true
                },
                tableHeader: {
                    fontSize: 14,
                    bold: true
                },
                title: {
                    fontSize: 26,
                    alignment: 'center'
                },
                im: {
                    alignment: 'center'
                }
            },
            content: [
                {
                    image: 'data:image/png;base64,', width: 103, height: 22
                },
                // { text: 'Your Report', style: 'title' },
                {
                    columns: [
                                { text: 'Open Trial API Report', style: 'header', margin: [0, 10, 0, 10] },
                                { text: `Search Query: ${this.state.topic}`, style: 'header', alignment: 'right', margin: [0, 10, 0, 0] }
                            ]
                },
                {
                    table: {
                        // headers are automatically repeated if the table spans over multiple pages
                        // you can declare how many rows should be treated as headers
                        headerRows: 1,
                        body: dataWithHeaders
                    }
                }
            ]
        };
        this.setState({docDefinition});
        pdfMake.createPdf(docDefinition).getDataUrl( outDoc => {
            document.getElementById('pdfV').src = outDoc});
    };

    submitSearch = event => {
        event.preventDefault();
        this.setState({trials: []});
        let topic = event.target.parentElement.children[0].children[0].children[0].value;
        console.log(document.querySelector('select').value);
        let perPage = document.querySelector('select').value;
        API.getTrials(topic, perPage).then(res => {
            this.setState({ trials: res.items, topic: topic, savedTrials: [] });
        });
    };

    saveTrial = event => {
        // event.preventDefault();
        console.log(JSON.parse(event.target.parentElement.getAttribute('info')));
        this.setState({ savedTrials: [...this.state.savedTrials, JSON.parse(event.target.parentElement.getAttribute('info'))] });
    };

    removeTrial = event => {
        // event.preventDefault();
        console.log(event.target.parentElement);
        let result = JSON.parse(event.target.parentElement.getAttribute('info'));
        let newSavedTrials = this.state.savedTrials.filter(el => el.id !== result.id);
        this.setState({ savedTrials: newSavedTrials });
    };

    render() {
        return (
            <div className="App container" id="main-container">
                <h1>Open Trials Report</h1>
                {/* <img src="../images/openTrialsLogo.jpg"></img> */}
                <h5 className="instructions">Search for clinical and research trials by entering a query below. You can search for specific conditions, researchers, trials, institutitions, among other filters.</h5>
                <div className="">
                    <div>
                        <form id="form" onSubmit={this.submitSearch}>
                            <div className="form-group">
                                <input
                                    id="searchInput"
                                    type="text"
                                    placeholder="Find trial by keywords (eg. cancer)"
                                />
                                <button
                                    className="btn searchBtn btn-primary"
                                    type="submit"
                                    value="Search"
                                >
                                Search
                                </button>
                            </div>
                            <div className="row">
                                <div className="form-group ">
                                    <div className="input-field">
                                        <p className='white-text'>
                                        How many results to display: 
                                        </p>
                                        <select className="browser-default">
                                            <option value="10">10</option>
                                            <option value="25">25</option>
                                            <option value="50">50</option>
                                            <option value="100">100</option>
                                        </select>
                                    </div>
                                </div>
                            </div>
                        </form>
                        <button onClick={this.createPreview} className="btn modal-trigger" data-target="downloadModal">Download Report</button>
                    </div>
                </div>
                <div className="result-panel" >
                    <ul id='result-ul' className="collapsible resultBackground">
                        {this.state.trials.map((a, i) => (
                                <SearchRes key={i} number={i} removeTrial={this.removeTrial} saveTrial={this.saveTrial} resultObject={a} />
                            ))
                        }
                    </ul>
                </div>
                <div className="modal modal-fixed-footer" id="downloadModal">
                        <div className="modal-content">
                           
                            <h5 className="modal-title" id="exampleModalLabel">Name Your Report{this.state.fileNameInput !== '' ? `: ${this.state.fileNameInput}.pdf` : null }</h5>
                                <form>
                                    <input onChange={this.handleInputChange}
                                        className="validate"
                                        value={this.state.fileNameInput} placeholder="eg. my_first_report" type="text" id="fileNameInput" name="fileNameInput"/>
                                </form>
                            < iframe id='pdfV' title="pdfPreview" style={{ "width": 600, 'height': 375 }} > </ iframe>
                           </div>
                            
                            <div className="modal-footer">
                           
                        <button
                            style={{marginRight: 6}} type="button" className="modal-close btn red">
                                    Close
                                </button>
                                <button type="submit" onClick={this.downloadPdf} className="btn btn-primary">Download</button>
                            </div>
                        </div>
            </div>
        )
    };
};
export default homePage;